description:
Death Sin is about a 17 year old boy named Connor who must live with a terrible secret. He was born with a cursed right eye that draws him to scenes of immense cruelty and violence. Drawn to punish sinners whenever he finds them he must find the reason why he holds the power to send others to Hell.

